import React from "react";

import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Projects from "./pages/Projects";

const Routes = () => {
    return (
        <Router>
            <Route path="/projects" exact Component={Projects} />

        </Router>
    )
}

export default Routes;
